Yip Man 2: Chung Si Chuen Kei (2010) 
Alternatieve titels: Ip Man 2: Legend of the Grandmaster, Ye Wen 2: Zong Shi Chuan Qi 

Hongkong
Actie
108 minuten

geregisseerd door Wilson Yip
met Donnie Yen, Sammo Hung Kam-Bo en Darren Shahlavi

Ip Man is de grote meester van de Wing Chun-stijl van kung fu. Ip Man's trouw aan Wing Chun is een klassiek voorbeeld van liefde en respect. Hij reist naar Hong Kong om zijn vechtkunsten te vertonen en de discipline van deze stijl te verspreiden. Hij komt hier een oude bekende tegen..

